// outputs.jsx
import React from "react";

const Outputs = ({ grade }) => {
  return (
    <section className="outputs">
      <h3>Your Grades</h3>
      <p className="outputs--element">
        Your Grade:{" "}
        <span style={{ fontWeight: "bold" }}>{grade.toFixed(2)}%</span>
      </p>
    </section>
  );
};

export default Outputs;
